package com.base.idcard;

import android.os.Parcel;
import android.os.Parcelable;

/**
 * Created by Zhu TingYu on 2017/11/30.
 */

public class IdCardNInfoEntity implements Parcelable {

    /**
     * errorcode : 0
     * errormsg : OK
     * session_id :
     * name_confidence_all : []
     * sex_confidence_all : []
     * nation_confidence_all : []
     * birth_confidence_all : []
     * address_confidence_all : []
     * id_confidence_all : []
     * frontimage_confidence_all : []
     * watermask_confidence_all : []
     * valid_date : 2012.06.25-2022.06.25
     * valid_date_confidence_all : [99,99,99,99,99,99,99,99,99,99,99,99,99,99,99,77,99,99,99,99,99]
     * authority : 建瓯市公安局
     * authority_confidence_all : [99,99,99,99,99,99]
     * backimage : 
     * backimage_confidence_all : []
     */

    public int errorcode;
    public String errormsg;
    public String session_id;
    public String valid_date;
    public String authority;
    public String backimage;

    @Override
    public int describeContents() {
        return 0;
    }

    @Override
    public void writeToParcel(Parcel dest, int flags) {
        dest.writeInt(this.errorcode);
        dest.writeString(this.errormsg);
        dest.writeString(this.session_id);
        dest.writeString(this.valid_date);
        dest.writeString(this.authority);
        dest.writeString(this.backimage);
    }

    public IdCardNInfoEntity() {
    }

    protected IdCardNInfoEntity(Parcel in) {
        this.errorcode = in.readInt();
        this.errormsg = in.readString();
        this.session_id = in.readString();
        this.valid_date = in.readString();
        this.authority = in.readString();
        this.backimage = in.readString();
    }

    public static final Creator<IdCardNInfoEntity> CREATOR = new Creator<IdCardNInfoEntity>() {
        @Override
        public IdCardNInfoEntity createFromParcel(Parcel source) {
            return new IdCardNInfoEntity(source);
        }

        @Override
        public IdCardNInfoEntity[] newArray(int size) {
            return new IdCardNInfoEntity[size];
        }
    };
}
